INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Solar radiation summer solstice','radsumsol','Total insolation derived from direct and diffuse, but not reflected, radiation for the summer solstice','continuous','235.97','49,006.19','25,061.46','6,312.49','1','set by tool (square)','default (200 x 200 viewshed, sky direction, and sun position rasters)','1 arc-second digital elevation model','USGS NED','Expected to be the most important solar radiation variable. Team concurred to use all tool defaults.',0,6,1);
INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Solar radiation equinox','radequinx','Total insolation derived from direct and diffuse, but not reflected, radiation for the equinox','continuous','193.58','42,560.51','19,682.00','5,990.69','1','set by tool (square)','default (200 by 200 viewshed, sky direction, and sun position rasters)','1 arc-second digital elevation model','USGS NED','Team agreement that this variable could be useful. Team concurred to use all tool defaults. Fall and spring equinox values are equivalent, so only need one variable instead of two as previously thought.',0,6,1);
INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Solar radiation winter solstice','radwinsol','Total insolation derived from direct and diffuse, but not reflected, radiation for the winter solstice','continuous','161.69','37,711.49','16,111.40','5,652.38','1','set by tool (square)','default (200 by 200 viewshed, sky direction, and sun position rasters)','1 arc-second digital elevation model','USGS NED','The findings of Piedallu and Gegout 2008 suggest that this one might be important. Team concurred to use all tool defaults.',0,6,1);
