INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Beers aspect','beersx1000','Beers et al. (1966) transformation of slope direction. Original scale is 0 (SW, most exposed) to 2 (NE, most sheltered), with values grading equivalently in both directions between the extremes.','continuous','0.00','2.00','0.99','0.48','1000','set by tool (square)','set by tool (3x3)','1 arc-second digital elevation model','USGS NED','Formula: Beers Aspect = (cos((45-Aspect)*pi/180)+1). Any cells with slope less than 3 degrees are assigned neutral value of 1.',0,NULL,1);
INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Dist to inland waters','distinlwat','Euclidean distance to nearest stream, river, or other inland waterbody (excluding estuaries)','continuous','0.00','21,641.00','448.17','1,175.09','1','n/a','n/a','high-res hydrography features; 30-m pixel land cover; 1 arc-second digital elevation model','National Hydrography Dataset; National Land Cover Database; USGS NED','After initial run, realized several issues needing fixing in the Hydro layer used to produce distances to various hydro types. Issues included: gaps in ocean coverage of the SDM processing boundary (at periphery); portions of some inland streams/lakes/rivers should have been classed as estuaries; portions of some sea/oceans should have been classed as estuaries or even inland waters. Had to create new data layers to be used to fix the raw Hydro layer. This included some manual splitting and recoding of sea/ocean polygons. The "Fix NHD Hydro Raster" tool was then used to produce a better hydro layer from the original. Still, distance to coastal waters would be inflated in the northeast due to lack of NHD data in Canada. Modified the fix to grab Canadian coastal waters and burn them in. (This whole thing turned out to be a way bigger PITA than expected).',1,NULL,1);
INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Dist to stream','diststrm','Euclidean distance to nearest stream (features represented by lines only)','continuous','0.00','41,073.42','755.17','2,288.31','1','n/a','n/a','high-res hydrography features; 30-m pixel land cover; 1 arc-second digital elevation model','National Hydrography Dataset; National Land Cover Database; USGS NED','',1,NULL,1);
INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Dist to lake or river','distlakriv','Euclidean distance to nearest river or other inland waterbody (features represented by polygons)','continuous','0.00','21,721.37','1,021.65','1,343.37','1','n/a','n/a','high-res hydrography features; 30-m pixel land cover; 1 arc-second digital elevation model','National Hydrography Dataset; National Land Cover Database; USGS NED','OBSOLETE',1,NULL,1);
INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Dist to coastal waters','distcstwat','Euclidean distance to nearest estuary or sea/ocean. [This probably can be tossed since only differs from estuaries if you�re in the middle of the ocean or on an island with no estuaries identified]','continuous','0.00','502,430.59','144,187.83','119,376.10','1','n/a','n/a','high-res hydrography features; 30-m pixel land cover; 1 arc-second digital elevation model','National Hydrography Dataset; National Land Cover Database; USGS NED','',1,NULL,1);
