INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Slope length','slopelen','The longest upslope distance along the flow path to the top of the drainage divide, plus the downslope distance along the flow path to a water or wetland feature.','continuous','','','','','TBD','n/a','n/a','flow direction and high-res hydrography','EPA/USGS NHD Plus v. 2; NHDH','OBSOLETE. In combination with Distance Down, replaces Relative Slope Position',0,NULL,1);
INSERT INTO `lkpEnvVars` (fullName,gridName,description,dataType,min,max,mean,stdev,multiplier,windowShape,windowSize,derivedFrom,originalSource,comments,distToGrid,correlatedVarGroupings,use_T) VALUES ('Topographic moisture','flowacc','Flow accumulation is used as a proxy for topographic moisture. For each cell, this is determined by summing the weights of all cells flowing into it. This does not account for flow differences over different soil types.','continuous','','','','','n/a','n/a','n/a','30-m, medium-resolution flow accumulation rasters; high-resolution hydrography','EPA/USGS NHD Plus v. 2; NHDH','Flow accumulation rasters were obtained from NHDPlus. These rasters were mosaicked to produce a single raw flow accumulation raster. The raw flow accumulation was modified by truncating values at 99,999. Then, wetlands and open waters were "burned in" with values as follows: wetlands: 99,999; streams: 199,999; rivers and lakes: 299,999; estuaries: 399,999; oceans: 499,999.',0,NULL,1);
