BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `tblModelResultsVarsUsed` (
	`model_run_name`	TEXT,
	`gridName`	TEXT,
	`inFinalModel`	INTEGER,
	`impVal`	REAL,
	FOREIGN KEY(`model_run_name`) REFERENCES `tblModelResults`(`model_run_name`),
	PRIMARY KEY(`model_run_name`,`gridName`)
);
CREATE TABLE IF NOT EXISTS `tblModelResultsCutoffs` (
	`model_run_name`	TEXT,
	`ElemCode`	TEXT,
	`dateTime`	TEXT,
	`cutCode`	TEXT,
	`cutValue`	REAL,
	`capturedEOs`	INTEGER,
	`capturedPolys`	INTEGER,
	`capturedPts`	INTEGER,
	FOREIGN KEY(`model_run_name`) REFERENCES `tblModelResults`(`model_run_name`),
	PRIMARY KEY(`model_run_name`,`cutCode`)
);
CREATE TABLE IF NOT EXISTS `tblModelResults` (
	`model_run_name`	TEXT,
	`EGT_ID`	INTEGER,
	`table_code`	TEXT,
	`internal_comments`	TEXT,
	`metadata_comments`	TEXT,
	`model_comp_name`	TEXT,
	`modeller`	TEXT,
	`model_start_time`	TEXT,
	`model_end_time`	TEXT,
	`r_version`	TEXT,
	`repo_head`	TEXT,
	PRIMARY KEY(`model_run_name`),
	FOREIGN KEY(`model_run_name`) REFERENCES `tblModelResults`(`model_run_name`)
);
CREATE TABLE IF NOT EXISTS `tblModelInputsHucs` (
	`table_code`	TEXT,
	`huc_06`	INTEGER,
	`huc_08`	INTEGER,
	`huc_10`	INTEGER,
	PRIMARY KEY(`table_code`),
	FOREIGN KEY(`table_code`) REFERENCES `tblModelInputs`(`table_code`)
);
CREATE TABLE IF NOT EXISTS `tblModelInputs` (
	`table_code`	TEXT,
	`EGT_ID`	INTEGER,
	`datetime`	TEXT,
	`filename_pres`	TEXT,
	`filename_bkgd`	TEXT,
	`feat_count`	INTEGER,
	`feat_grp_count`	INTEGER,
	`obs_count`	INTEGER,
	`bkgd_count`	INTEGER,
	`range_clip_definitionXXX`	TEXT,
	`range_area_sqkm`	REAL,
	`range_area_huc_count`	INTEGER,
	PRIMARY KEY(`table_code`)
);
CREATE TABLE IF NOT EXISTS `mapDataSourcesToSpp` (
	`DataSourcesToSpeciesID`	INTEGER NOT NULL,
	`DataSourcesID`	INTEGER,
	`EGT_ID`	INTEGER,
	PRIMARY KEY(`DataSourcesToSpeciesID`)
);
CREATE TABLE IF NOT EXISTS `lkpThresholdTypes` (
	`ID`	INTEGER,
	`cutCode`	TEXT,
	`cutFullName`	TEXT,
	`cutDescription`	TEXT,
	`cutCitationShort`	TEXT,
	`cutCitationFull`	TEXT,
	`sortOrder`	INTEGER,
	PRIMARY KEY(`ID`)
);
CREATE TABLE IF NOT EXISTS `lkpSpecies` (
	`EGT_ID`	INTEGER NOT NULL,
	`sp_code`	TEXT NOT NULL UNIQUE,
	`broad_group`	INTEGER,
	`tax_group`	INTEGER,
	`scientific_name`	TEXT,
	`common_name`	TEXT,
	`ELCODE_BCD`	TEXT,
	`g_rank`	INTEGER,
	`rounded_g_rank`	INTEGER,
	`esa_status`	TEXT,
	`major_hab`	TEXT,
	`ModelerID`	INTEGER,
	`Comment`	TEXT,
	`modtype`	TEXT,
	PRIMARY KEY(`EGT_ID`)
);
CREATE TABLE IF NOT EXISTS `lkpRange` (
	`range_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`EGT_ID`	INTEGER,
	`huc10_id`	TEXT,
	`origin`	TEXT,
	`occurrence`	TEXT,
	`version_info`	TEXT,
	`comments`	TEXT
);
CREATE TABLE IF NOT EXISTS `lkpModtype` (
	`MODTYPE`	CHARACTER ( 1 ),
	`MODTYPE_desc`	text,
	PRIMARY KEY(`MODTYPE`)
);
CREATE TABLE IF NOT EXISTS `lkpModelers` (
	`ModelerID`	INTEGER NOT NULL,
	`ProgramName`	TEXT,
	`FullOrganizationName`	TEXT,
	`City`	TEXT,
	`State`	TEXT,
	PRIMARY KEY(`ModelerID`)
);
CREATE TABLE IF NOT EXISTS `lkpEnvVarsAqua` (
	`fullName`	TEXT,
	`gridName`	TEXT,
   `fileName`  TEXT,
	`description`	TEXT,
	`dataType`	TEXT,
	`multiplier`	TEXT,
	`category`	TEXT,
	`comments`	TEXT,
	`distToGrid`	INTEGER,
	`correlatedVarGroupings`	INTEGER,
	`use_A`	INTEGER,
	`use_R`	INTEGER,
	`use_L`	INTEGER,
	PRIMARY KEY(`gridName`)
);
CREATE TABLE IF NOT EXISTS `lkpEnvVars` (
	`fullName`	TEXT,
	`gridName`	TEXT,
   `fileName`  TEXT,
	`description`	TEXT,
	`dataType`	TEXT,
	`min`	TEXT,
	`max`	TEXT,
	`mean`	TEXT,
	`stdev`	TEXT,
	`multiplier`	TEXT,
	`windowShape`	TEXT,
	`windowSize`	TEXT,
	`derivedFrom`	TEXT,
	`originalSource`	TEXT,
	`comments`	TEXT,
	`distToGrid`	INTEGER,
	`correlatedVarGroupings`	INTEGER,
	`use_T`	INTEGER,
	PRIMARY KEY(`gridName`)
);
CREATE TABLE IF NOT EXISTS `lkpDataSources` (
	`DataSourcesID`	INTEGER NOT NULL,
	`ProgramName`	TEXT,
	`State`	TEXT,
	`DataProvidedDate`	TEXT,
	PRIMARY KEY(`DataSourcesID`)
);
COMMIT;
